            allowedTags: ['p', 'h3', 'h4', 'pre', 'a', 'i', 'b', 'em', 'strong', 'ul', 'ol', 'li', 'img', 'iframe', 'blockquote', 'table', 'tr', 'td', 'th', 'tbody', 'thead', 'span', 'br', 'hr', 'dl', 'dd', 'dt'],
